import React from 'react';
import './App.css';



function App() {
  return (
    <div className="App">
        <header>
            <img src='https://avatars.mds.yandex.net/i?id=a030b92775b9967c5c4d05fb136fbfe6f414f98d-8454246-images-thumbs&n=13&exp=1'></img>
        </header>
        <nav>
            <div>Profile</div>
            <div>News</div>
            <div>Message</div>
            <div>Music</div>
        </nav>
        <div>
        Main Content
        </div>
    </div>
  );
}

export default App;
